export default class Test extends Component {
  state = {
    isLoading: true,
    startAnimation: false
  };
  componentDidMount = () => {
    this.setState({ isLoading: false }, () => {
      this.startAnimation();
    });
  };
  startAnimation = () => {
    setTimeout(() => {
      this.setState({ startAnimation: true });
